import React from 'react';
import About from './components/About';
import Contact from './components/Contact';
import PizzaMenu from './components/PizzaMenu';
import OrderNow from './components/OrderNow';

export default function App(){
  return (
    <div className="app">
      <header className="header">
        <h1>Pizzaria Don Chevico</h1>
        <nav>
          <a href="#about">Sobre</a> | <a href="#menu">Sabores</a> | <a href="#order">Peça Agora</a> | <a href="#contact">Contato</a>
        </nav>
      </header>

      <main>
        <section id="about"><About /></section>
        <section id="menu"><PizzaMenu /></section>
        <section id="order"><OrderNow /></section>
        <section id="contact"><Contact /></section>
      </main>

      <footer>© Pizzaria Don Chevico</footer>
    </div>
  );
}
